import {BsGridFill, BsMenuButtonWideFill, BsCaretLeftSquareFill, BsMicFill, BsChatDotsFill, BsFileTextFill, BsFillBookFill, BsPlayBtnFill, BsImages, BsPencilSquare, BsFillPeopleFill, BsFillTelephoneFill} from 'react-icons/bs';
import {APP_PREFIX_PATH, AUTH_PREFIX_PATH} from '../../config/AppConfig'; 
import {AUTH_TOKEN} from '../../redux/constants/Auth';


export const items = [
    {
        key: `${APP_PREFIX_PATH}/home`, 
        icon: <BsGridFill/>, 
        label: 'Dashboard'
    },
    {
        key: `${APP_PREFIX_PATH}/courses`, 
        icon: <BsMenuButtonWideFill/>, 
        label: 'Kurslar'
    },
    {
        key: `${APP_PREFIX_PATH}/webinar`, 
        icon: <BsMicFill/>, 
        label: 'Webinarlar'
    },
    {
        key: `${APP_PREFIX_PATH}/certificate`,
        icon: <BsFileTextFill/>, 
        label: 'Sertifikatlar'
    },
    {
        key: `${APP_PREFIX_PATH}/support`, 
        icon: <BsChatDotsFill/>, 
        label: 'Support'
    },
    {
        key: `${APP_PREFIX_PATH}/post`, 
        icon: <BsImages/>, 
        label: 'Post yuklash'
    },
    {
        key: `${APP_PREFIX_PATH}/about`, 
        icon: <BsPlayBtnFill/>, 
        label: 'Video Malumot'
    },
    {
        key: `${APP_PREFIX_PATH}/coursesList`, 
        icon: <BsPencilSquare/>, 
        label: 'Kurs ma\'lumotlari'
    },
    {
        key: `${APP_PREFIX_PATH}/teams`, 
        icon: <BsFillPeopleFill/>, 
        label: 'Hodimlar'
    },
    {
        key: `${APP_PREFIX_PATH}/contact`, 
        icon: <BsFillTelephoneFill/>, 
        label: 'Kontaktlar'
    },
    {
        key: AUTH_PREFIX_PATH,
        icon: <BsCaretLeftSquareFill/>, 
        label: <div onClick={() => localStorage.removeItem(AUTH_TOKEN)}> Hisobdan chiqish </div>
    }
];
